import React, { Component } from "react";
import "./App.css";
import Home from "./Pages/Home"
import Collectables from "./Pages/Collectables"

class App extends Component {
  render() {
    return (
      <div className="App">
        <Home/>
        <Collectables/>

      </div>
    );
  }
}

export default App;
